import React, { useState, useEffect } from "react";
import { useFormAction } from "react-router-dom";

function SignupForm(){
    const [userInfo, setUserInfo] = useState({firstname: "", lastname: "", email: "", password: ""})
    let firstName
    let lastName
    let email
    let password

    function handleChange(event){
        setUserInfo(userInfo => [...userInfo, {e: e.target.value}])
    }

    return (
        <div id="container">
            <div id="content">
                <form>
                    <input
                        value={firstName}
                        onChange={e => setUserInfo(userInfo => [...userInfo, {firstname: e.target.value}])}
                        placeholder="Voornaam"
                        type="text"
                        name="firstname"
                        required
                    />
                    <input
                        value={lastName}
                        onChange={e => setUserInfo(userInfo => [...userInfo, {lastname: e.target.value}])}
                        placeholder="Achternaam"
                        type="text"
                        name="lastname"
                        required
                    />
                    <input
                        value={email}
                        onChange={e => setUserInfo(userInfo => [...userInfo, {email: e.target.value}])}
                        placeholder="E-mailadres"
                        type="email"
                        name="email"
                        required
                    />
                    <input
                        value={password}
                        onChange={e => setUserInfo(userInfo => [...userInfo, {password: e.target.value}])}
                        placeholder="Wachtwoord"
                        type="password"
                        name="password"
                        required
                    />
                    <button type="submit">Registreer</button>
                    Welkom
                    {console.log(userInfo)}
                </form>
            </div>
        </div>
    );

}

export default SignupForm;
